.filter_box_list .filter_wrap .fbox_size {
  border-right: 1px solid #ccc;

  ul {
    margin-top: 10px;
    display: flex;
    align-items: center;
    flex-wrap: wrap;

    li {
      margin-bottom: 10px;
      margin-right: 10px;

      input {
        display: none;
      }

