#size_chk01:checked ~ .size01, #size_chk02:checked ~ .size02, #size_chk03:checked ~ .size03, #size_chk04:checked ~ .size04, #size_chk05:checked ~ .size05, #size_chk06:checked ~ .size06, #size_chk07:checked ~ .size07, #size_chk08:checked ~ .size08, #size_chk09:checked ~ .size09, #size_chk10:checked ~ .size10, #size_chk11:checked ~ .size11, #size_chk12:checked ~ .size12, #size_chk13:checked ~ .size13, #size_chk14:checked ~ .size14 {
