/**********상품리스트*************/

.sublist {
  width: 100%;
  display: flex;
  flex-wrap: wrap;
}

.subBox {
  width: calc(100% - 75% - 25px);

  /* height: 550px; */
  margin-left: 20px;
  margin-bottom: 50px;
  cursor: pointer;
  transition: .3s;
  display: block;
}

.subimg_wrap {
  font-size: 0;
  position: relative;
  overflow: hidden;
  transition: .3s;

  &:hover {
    img {
      transform: scale(1.05);
    }

    box-shadow: 0 0 15px black;

    .hoverBox {
      /* opacity: 1; */
      bottom: 0;
    }
  }
}

.hoverBox {
  width: 100%;
  height: 50px;
  line-height: 50px;
  position: absolute;
  z-index: 999;
  bottom: -50px;

  /* opacity: 0; */
  left: 0;
  width: 100%;
  background-color: rgba(0, 0, 0, 0.5);
  transition: .3s;
}

.hoverWrap {
  display: flex;
  text-align: center;
  color: #fff;
}

.like {
  width: 50%;
  font-size: 25px;
  transition: .3s;
  cursor: pointer;

  &:hover {
    color: red;
  }
}

.cart {
  width: 50%;
  font-size: 25px;
  transition: .3s;
  cursor: pointer;

  &:hover {
    color: #002053;
  }
}

.subimg {
  width: 100%;
  transition: .5s;
}

.subBox:nth-child(4n) {
  margin-right: 0;
}

.item_wrap {
  /* display: flex; */
}

.item_desc_wrap {
  width: 100%;
}

.item_category {
  font-size: 12px;
  margin: 10px 0;
}

.item_name {
  font-size: 17px;
  margin-bottom: 10px;
}

.item_price {}

.buy_box {
  width: 100%;
  text-align: center;
  margin-top: 10px;

  /* position: relative; */
}

.buy_btn {
  &:hover {
    background-color: #002053;
    color: #fff;
    border: #002053;
    box-shadow: 0 0 10px black;
  }

  width: 100%;
  height: 40px;
  line-height: 40px;
  border-radius: 30px;
  border: 1px solid #ccc;
  background-color: #eee;

  /* position: absolute; */
  /* bottom: 0; */
  /* left: 50%; */
  /* transform: translateX(-50%); */
  transition: .3s;
}

/*********footer********/

footer {
  width: 100%;
  text-align: center;
  margin-top: 100px;
}

.footer_wrap {
  border-top: 1px solid #ccc;
  background-color: #eee;
  padding: 20px 10px;

  .footer_box1 {
    display: flex;

    .foot_logo {
      width: 20%;

      img {
        width: 90px;
        height: 30px;
      }
    }

    .foot_menu01 {
      width: 20%;
    }

    h4 {
      font-size: 20px;
      margin-bottom: 20px;
      cursor: pointer;
    }

    li {
      margin-bottom: 10px;
      cursor: pointer;
    }

    .foot_menu02, .foot_menu03, .foot_menu04 {
      width: 20%;
    }
  }

  .footer_box2 {
    margin-top: 50px;

    .foot_menu05 {
      display: flex;

      li {
        margin-bottom: 30px;
        cursor: pointer;
        font-weight: bold;

        &.red {
          color: red;
        }

        &.blue {
          color: blue;
        }
      }
    }

    .foot_menu05_1 {
      width: 20%;

      select {
        width: 45%;
        text-align: center;
        outline: none;
        background-color: #eee;
        border: 0;
        font-size: 16px;

        option:nth-child(1) {
          display: none;
        }
      }
    }
  }

  .footer_box3 {
    width: 100%;
    margin-top: 50px;

    .menu06 {
      display: flex;

      .menu06_1 {
        width: 50%;
        text-align: left;
        margin-left: 90px;

        .menu06_desc {
          p {}

          .foot_span01, .foot_span02 {
            text-decoration: underline;
            font-weight: bold;
            cursor: pointer;
          }
        }
      }

      .menu06_2 {
        width: 25%;
        text-align: left;
        padding-left: 50px;

        .cs_box {
          border: 1px solid black;
          text-align: center;

          /* width: 50%; */
          height: 35px;
          line-height: 35px;
          font-size: 22px;
          border-radius: 30px;
          margin-bottom: 20px;
        }

        h4 {
          margin-top: 10px;
          font-size: 20px;
        }

        p.day {
          font-size: 14px;
          margin-top: 10px;
        }
      }

      .menu06_3 {
        width: 25%;

        i {
          font-size: 35px;
          margin-left: 30px;
          cursor: pointer;

          &:nth-child(1) {
            margin-left: 0;
          }
        }
      }
    }
  }
}

/*******popup*******/

.pop01 {
  width: 150px;
  height: 150px;
  border-radius: 50%;
  background-color: #eee;
  position: absolute;
  top: 80px;
  right: 300px;
  display: block;

  p {
    text-align: center;
    font-size: 14px;
    margin: 40px 10px;
  }

  .popclose {
    font-size: 20px;
    color: #fff;
    text-align: right;
    cursor: pointer;
  }
}

/**********quick menu***************/

.quick_menu {
  width: 55px;
  border: 1px solid #ccc;
  position: absolute;
  right: 0px;
  top: 0px;
  z-index: 99998;
  background-color: #fff;
  transition: .3s;

  &:hover {
    width: 150px;
  }

  .quick_wrap .quick_box {
    display: flex;
    border-bottom: 1px solid #ccc;
    height: 50px;
    line-height: 50px;

    &:nth-child(4) {
      border-bottom: 0;
    }

    &:nth-child(1) {}

    .quick_icon {
      width: 30%;
      text-align: center;

      i {
        font-size: 30px;
        color: #999;
        transition: .3s;
      }

      .usericon {
        padding-left: 11px;
        padding-top: 7px;
      }

      .truck {
        padding-left: 8px;
        padding-top: 10px;
      }

      .boxopen {
        padding-left: 7px;
        padding-top: 10px;
      }

      .quicksearch {
        padding-left: 10px;
        padding-top: 10px;
      }
    }

    &:hover i {
      color: #002053;
    }

    .quick_text {
      width: 0%;
      text-align: center;
      overflow: hidden;

      a {
        font-size: 16px;
        display: block;
        width: 100%;

        &:hover {
          color: #002053;
          font-weight: bold;
        }
      }
    }
  }

  &:hover .quick_wrap .quick_box .quick_text {
    /* display: block; */
    width: 70%;
  }
}

